const baseURL = 'http://localhost:1234';

export const creteOrder = async (
  userId, sessionId
) => {
  const body = JSON.stringify({
    userId, sessionId
  });
  const response = await fetch(`${baseURL}/film/`, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body,
  });
  const data = await response.json();
  return data;
}
